        "readme": "<h1 id=\"spaniel-build-status-https-travis-ci-org-linkedin-spaniel-svg-branch-master-https-travis-ci-org-linkedin-spaniel-npm-version-https-badge-fury-io-js-spaniel-svg-https-www-npmjs-com-package-spaniel-\">Spaniel <a href=\"https://travis-ci.org/linkedin/spaniel\"><img src=\"https://travis-ci.org/linkedin/spaniel.svg?branch=master\" alt=\"Build Status\"></a> <a href=\"https://www.npmjs.com/package/spaniel\"><img src=\"https://badge.fury.io/js/spaniel.svg\" alt=\"npm version\"></a></h1>\n<p>LinkedIn&#39;s JavaScript viewport tracking library and <a href=\"https://github.com/WICG/IntersectionObserver\">IntersectionObserver</a> polyfill. Track what the user actually sees.</p>\n<pre><code class=\"lang-JavaScript\"><span class=\"hljs-keyword\">import</span> { IntersectionObserver } <span class=\"hljs-keyword\">from</span> <span class=\"hljs-string\">'spaniel'</span>;\n\n<span class=\"hljs-keyword\">new</span> IntersectionObserver(<span class=\"hljs-function\">(<span class=\"hljs-params\">entries</span>) =&gt;</span> { <span class=\"hljs-built_in\">console</span>.log(<span class=\"hljs-string\">'I see you'</span>) }, {\n  <span class=\"hljs-attr\">threshold</span>: <span class=\"hljs-number\">0.5</span>\n}).observe(<span class=\"hljs-built_in\">document</span>.getElementById(<span class=\"hljs-string\">'my-element'</span>));\n</code></pre>\n<p>Practical uses included:</p>\n<ul>\n<li>Determining advertisement impressions</li>\n<li>Impression discounting feedback for relevance systems</li>\n<li>Occlusion culling - Don&#39;t render an object until user is close to scrolling the object into the viewport</li>\n</ul>\n<h2 id=\"-usage-and-api-docs-https-linkedin-github-io-spaniel-\"><a href=\"https://linkedin.github.io/spaniel/\">Usage and API Docs</a></h2>\n<p>Spaniel provides additional abstractions on top of <a href=\"https://github.com/WICG/IntersectionObserver\">IntersectionObserver</a>, provides APIs for hooking into the low-level internals, and has some limitations as a non-complete polyfill. Learn more by reading the <a href=\"https://linkedin.github.io/spaniel/\">Usage and API Docs</a>.</p>\n<h2 id=\"why-use-spaniel-\">Why use Spaniel?</h2>\n<ul>\n<li>Provides the future-proofing of a WCIG API, but with an expanded feature-set built upon said API.</li>\n<li>Tested and iterated upon in production by LinkedIn since late 2014</li>\n<li>Highly performant, only relies on <code>requestAnmiationFrame</code></li>\n<li>Extensive <code>requestAnmiationFrame</code> task/utility API</li>\n</ul>\n<h4 id=\"how-is-it-tested-\">How is it tested?</h4>\n<p>Spaniel has both unit tests and a headless test suite. The headless tests are run using <a href=\"https://github.com/segmentio/nightmare\">Nightmare</a>.</p>\n<h4 id=\"how-big-is-spaniel-\">How big is Spaniel?</h4>\n<p>Checkout <a href=\"https://github.com/linkedin/spaniel/blob/gh-pages/size.txt\">size.txt</a> to see the current minified UMD gzipped size.</p>\n<p>You can also run <code>npm run stats</code> to measure locally.</p>\n<h2 id=\"installation\">Installation</h2>\n<p>Spaniel is a standard NPM/CommonJS module. You can use a build tool like <a href=\"http://browserify.org/\">browserify</a> or <a href=\"https://www.npmjs.com/package/webpack\">webpack</a> to include Spaniel in your application.</p>\n<p>If you&#39;re using <a href=\"http://rollupjs.org/\">rollup</a>, an ES6 version is built at <code>/exports/es6/spaniel.js</code> (as noted by <code>jsnext:main</code> in <code>package.json</code>).</p>\n<p>Alternatively, running <em>npm run build</em> will generate a UMD file at <code>/exports/spaniel.js</code>, and a minified UMD file at <code>/exports/min/spaniel.js</code>. You can use the minified file in production.</p>\n<h2 id=\"development-setup\">Development setup</h2>\n<p>The Spaniel source code is written in <a href=\"https://www.typescriptlang.org/\">TypeScript</a>.</p>\n<p>You will need <code>testem</code> installed globally to run the tests.</p>\n<pre><code>npm <span class=\"hljs-keyword\">install</span> -g testem\n</code></pre><p>You will also need to install <a href=\"http://phantomjs.org/download.html\">phantom.js</a> globally.</p>\n<pre><code>// Install dependencies\nnpm install\n\n// <span class=\"hljs-keyword\">Run</span><span class=\"bash\"> build\n</span>npm <span class=\"hljs-keyword\">run</span><span class=\"bash\"> build\n</span>\n// Watch and auto-rebuild\nnpm <span class=\"hljs-keyword\">run</span><span class=\"bash\"> watch\n</span>\n// Serve test app\nnpm <span class=\"hljs-keyword\">run</span><span class=\"bash\"> serve\n</span>\n// <span class=\"hljs-keyword\">Run</span><span class=\"bash\"> the tests\n</span>npm <span class=\"hljs-keyword\">run</span><span class=\"bash\"> <span class=\"hljs-built_in\">test</span></span>\n</code></pre><h2 id=\"intersectionobserver-resources\">IntersectionObserver Resources</h2>\n<ul>\n<li><a href=\"https://github.com/WICG/IntersectionObserver\">https://github.com/WICG/IntersectionObserver</a></li>\n<li><a href=\"https://developer.mozilla.org/en-US/docs/Web/API/Intersection_Observer_API\">https://developer.mozilla.org/en-US/docs/Web/API/Intersection_Observer_API</a></li>\n</ul>\n<h2 id=\"copyright\">Copyright</h2>\n<p>Copyright 2017 LinkedIn Corp.  All rights reserved.</p>\n",
